#pragma once

#include <vector>
#include <random>

std::vector<std::vector<double>> generateRandomMatrix(int N) {
    std::random_device rd;
    std::mt19937 gen(rd());
    std::uniform_real_distribution<double> dis(-100.0, 100.0);

    std::vector<std::vector<double>> matrix(N, std::vector<double>(N));

    for (int i = 0; i < N; ++i) {
        for (int j = 0; j < N; ++j) {
            matrix[i][j] = dis(gen);
        }
    }

    return matrix;
}

std::vector<double> generateRandomVector(int N) {
    std::random_device rd;
    std::mt19937 gen(rd());
    std::uniform_real_distribution<double> dis(-10.0, 10.0);

    std::vector<double> vector(N);

    for (int i = 0; i < N; ++i) {
        vector[i] = dis(gen);
    }

    return vector;
}

#include <iostream>
#include <vector>
#include <thread>
#include "random_gen.cpp"

void gaussianElimination(std::vector<std::vector<double>>& A, std::vector<double>& b, int startRow, int endRow) {
    int n = A.size();

    for (int i = startRow; i < endRow; ++i) {
        for (int j = i + 1; j < n; ++j) {
            double ratio = A[j][i] / A[i][i];
            for (int k = i; k < n; ++k) {
                A[j][k] -= ratio * A[i][k];
            }
            b[j] -= ratio * b[i];
        }
    }
}

const double EPS = 1e-9;

void parallelGaussianElimination(std::vector<std::vector<double>>& A, std::vector<double>& b, int numThreads) {
    int n = A.size();
    int rowsPerThread = n / numThreads;

    std::vector<std::thread> threads;
    for (int i = 0; i < numThreads; ++i) {
        int startRow = i * rowsPerThread;
        int endRow = (i == numThreads - 1) ? n : (startRow + rowsPerThread);
        threads.emplace_back(gaussianElimination, std::ref(A), std::ref(b), startRow, endRow);
    }

    for (std::thread& t : threads) {
        t.join();
    }

    //     
    for (int i = n - 1; i > 0; --i) {
        for (int j = i - 1; j >= 0; --j) {
            double ratio = A[j][i] / A[i][i];
            for (int k = i; k < n; ++k) {
                A[j][k] -= ratio * A[i][k];
            }
            b[j] -= ratio * b[i];
        }
    }

    std::vector<double> solution;
    for (int i = 0; i < n; ++i) {
        if (std::abs(A[i][i]) < EPS && std::abs(b[i]) < EPS) {
            std::cout << "INFINITY SOLUTIONS" << std::endl;
            return;
        } else if (std::abs(A[i][i]) < EPS) {
            std::cout << "NO SOLUTION" << std::endl;
            return;
        } else {
            solution.push_back(b[i] / A[i][i]);
        }
    }

//     for (const auto& elem : solution) {
//         std::cout << elem << " ";
//     }
//     std::cout << std::endl;
}

int main() {
    for (int thread_count = 8; thread_count <= 8; thread_count += 2) {
        std::cout << "thread_count " << thread_count << std::endl;
        for (int n = 5; n <= 2005; n += 100) {
            std::vector<std::vector<double>> A = generateRandomMatrix(n);
            std::vector<double> b = generateRandomVector(n);
            clock_t res = 0;
            for (int j = 0; j < 30; ++j) {
                clock_t start = clock();
                parallelGaussianElimination(A, b, thread_count);
                clock_t end = clock();
                res += (end - start);
            }
            std::cout << n << ": " << (double) res / (CLOCKS_PER_SEC * 30) << std::endl;
        }
    }

    return 0;
}

