const double EPS = 1e-9;

void gaussianElimination(std::vector<std::vector<double>>& A, std::vector<double>& b) {
    int n = A.size();

    for (int i = 0; i < n - 1; ++i) {
        //      
        int maxRow = i;
        for (int j = i + 1; j < n; ++j) {
            if (std::abs(A[j][i]) > std::abs(A[maxRow][i])) {
                maxRow = j;
            }
        }

        //  ,       
        std::swap(A[i], A[maxRow]);
        std::swap(b[i], b[maxRow]);

        //     
        for (int j = i + 1; j < n; ++j) {
            double ratio = A[j][i] / A[i][i];
            for (int k = i; k < n; ++k) {
                A[j][k] -= ratio * A[i][k];
            }
            b[j] -= ratio * b[i];
        }
    }

    //     
    for (int i = n - 1; i > 0; --i) {
        for (int j = i - 1; j >= 0; --j) {
            double ratio = A[j][i] / A[i][i];
            for (int k = i; k < n; ++k) {
                A[j][k] -= ratio * A[i][k];
            }
            b[j] -= ratio * b[i];
        }
    }

    std::vector<double> solution;
     for (int i = 0; i < n; ++i) {
         if (std::abs(A[i][i]) < EPS && std::abs(b[i]) < EPS) {
             std::cout << "INFINITY SOLUTIONS" << std::endl;
             return;
         } else if (std::abs(A[i][i]) < EPS) {
             std::cout << "NO SOLUTION" << std::endl;
             return;
         } else {
             solution.push_back(b[i] / A[i][i]);
         }
     }

//     for (const auto& elem : solution) {
//         std::cout << elem << " ";
//     }
//     std::cout << std::endl;
}


int main() {
    for (int n = 5; n <= 2005; n += 100) {
        std::vector<std::vector<double>> A = generateRandomMatrix(n);
        std::vector<double> b = generateRandomVector(n);
        clock_t res = 0;
        for (int j = 0; j < 30; ++j) {
            clock_t start = clock();
            gaussianElimination(A, b);
            clock_t end = clock();
            res += (end - start);
        }
        std::cout << n << ": " << (double)res / (CLOCKS_PER_SEC * 30) << std::endl;
    }


    return 0;
}

