int find_scnd_max(int array[], int arraySize)
{
    int maxElement = array[0];
    int scndMaxElement = array[0];

    for(int i=1; i<arraySize; i++)
    {
        if(array[i]>maxElement)
        {
            scndMaxElement = maxElement;
            maxElement = array[i];
        }
    }

    return scndMaxElement;
}

