using System;
using System.Linq;
using System.Collections.Generic;
namespace CombConsole {
    public class Comb {
        public static IEnumerable<List<T>> SubSetsGeneration<T>(T[] input) {
            var resList = new List<List<T>>();
            int n = input.Length;
            int[] a = new int[n + 1];
            while (a[n] != 1) {
                var list = new List<T>();
                for (int i = 0; i < n; i++)
                    if (a[i] == 1)
                        list.Add(input[i]);
                resList.Add(list);
                int j = 0;
                while (a[j] == 1) {
                    a[j] = 0;
                    j++;
                }
                a[j] = 1;
            }
            return resList;
        }
        public static IEnumerable<List<T>> RepetitionPlacing<T>(T[] input, int k) {
            var resList = new List<List<T>>();
            int n = input.Length;
            int[] b = new int[k];
            while (b[k - 1] != n - 1) {
                var list = new List<T>();
                for (int i = 0; i < k; i++)
                    list.Add(input[b[i]]);
                resList.Add(list);
                int j = 0;
                while (b[j] == n - 1) {
                    b[j] = 0;
                    j++;
                }
                b[j]++;
            }
            return resList;
        }
        public static IEnumerable<List<T>> Combinations<T>(T[] input, int k) {
            var resList = new List<List<T>>();
            int n = input.Length;
            int[] b = new int[k];
            for (int i = 0; i < k; i++)
                b[i] = i;
            int ii = 0;
            while (ii != -1) {
                var list = new List<T>();
                for (int i = 0; i < k; i++)
                    list.Add(input[b[i]]);
                resList.Add(list);
                int mx = n - 1;
                ii = k - 1;
                for (; ii >= 0; ii--) {
                    if (b[ii] < mx) {
                        b[ii]++;
                        for (int j = ii + 1; j < k; j++)
                            b[j] = b[j - 1] + 1;
                        break;
                    }
                    mx = b[ii] - 1;
                }
            }
            return resList;
        }
        public static IEnumerable<List<T>> Permutations<T>(T[] input) {
            var reslist = new List<List<T>>();
            int n = input.Length;
            int[] a = new int[n];
            var list = new List<T>();
            for (int i = 0; i<n; i++) {
                a[i] = i;
                list.Add(input[a[i]]);
            }
            reslist.Add(list);
            bool bFound = true;
            while (bFound == true) {
                bFound = false;
                for (int i = n - 2; i >= 0; i--) {
                    var curlist = new List<T>();
                    if (a[i] < a[i + 1]) { // a[i] ,    a[i+1]
                        bFound = true;
                        int t = n + 1;  //    
                        int jnumb = -1; //   
                        for (int j = i + 1; j < n; j++) //   (  i+1)     a[i]
                            if (a[j] > a[i])   //    a[i]
                                if (a[j] < t) { //      
                                    t = a[j];
                                    jnumb = j;
                                }
                        if (jnumb != -1) {    //   ,    a[i]  a[jnumb]
                            int temp = a[i];
                            a[i] = a[jnumb];
                            a[jnumb] = temp;
                        }
                        //   (  i+1)
                        Array.Sort(a, i+1, n - i - 1);
                        for (int k = 0; k<n; k++)
                            curlist.Add(input[a[k]]);
                        reslist.Add(curlist);
                        break;
                    }
                }
            }
            return reslist;
        }
    }
