#include <bits/stdc++.h>
#define all(x) x.begin(), x.end()
#define sz(x) (int) x.size()
#define endl '\n'
#define pb push_back
#define _ ios_base::sync_with_stdio(false);cin.tie(NULL);cout.tie(NULL);
#define int ll

using namespace std;

using ll = long long;
using ull = unsigned long long;
using ii = pair<int,int>;
using iii = tuple<int,int,int>;

const int inf = 2e9+1;
const int mod = 1401387683;
const int MOD = 1e9+7;
const int maxn = 1e5+10;

template<typename X, typename Y> bool ckmin(X& x, const Y& y) { return (y < x) ? (x=y,1):0; }
template<typename X, typename Y> bool ckmax(X& x, const Y& y) { return (x < y) ? (x=y,1):0; }

mt19937 rng((int) chrono::steady_clock::now().time_since_epoch().count());

int uniform(int l, int r) {
      uniform_int_distribution<int> uid(l, r);
      return uid(rng);
}

int P, p[maxn];

vector<int> get_hash(string s) {
      int n = sz(s);
      vector<int> h(n);
      h[0] = s[0];
      for (int i = 1; i < n; ++i) {
            h[i] = (h[i-1] * P + s[i]) % mod;
      }
      return h;
}

const int limit = 325;

int help = 0;

int exist[maxn][27];

void insert(string s, int hash) {
      int cur = 0, n = sz(s);
      reverse(all(s));
      for (int i = 0; i < n; ++i) {
            int nxt = exist[cur][s[i] - 'a' + 1];
            if (!nxt) nxt = exist[cur][s[i] - 'a' + 1] = ++help;
            cur = nxt;
      }
      exist[cur][0] = hash;
}

int32_t main(){_
      int n; P = uniform(10000, mod - 1);
      cin >> n;
      p[0] = 1;
      for (int i = 1; i <= 1e5; ++i) p[i] = (p[i-1] * P) % mod;
      vector<string> vs(n);
      vector<int> h(n);
      vector<ii> big;
      for (int i = 0; i < n; ++i) {
            cin >> vs[i];
            h[i] = get_hash(vs[i]).back();
            if (sz(vs[i]) <= limit) insert(vs[i], h[i]);
            else big.pb({sz(vs[i]), h[i]});
      }    

      string s; cin >> s; n = sz(s);
      vector<int> dp(n + 1), hash = get_hash(s);

      auto segment = [&] (int l, int r) {
            --l, --r;
            int hsh = hash[r] - (l? hash[l-1]*p[r-l+1]%mod : 0);
            return hsh < 0 ? hsh + mod : hsh;
      };

      dp[0] = 1;

      sort(all(big));

      n = sz(s);

      for (int i = 1; i <= n; ++i) {
            int cur = 0;
            for (int j = i; j >= max(1ll, i - limit + 1); --j) {
                  int eu = s[j - 1] - 'a' + 1;
                  cur = exist[cur][eu];
                  if (!cur) break;
                  if (exist[cur][0]) dp[i] = (dp[i] + dp[j - 1]) % MOD;
            }
            int nao_rep = -1;
            for (auto [tam, hx] : big) {
                  if (tam > i) break;
                  int hsh = segment(i - tam + 1, i);
                  if (hsh == hx) {
                        nao_rep = tam;
                        dp[i] = (dp[i] + dp[i - tam]) % MOD;
                  } 
            }
      }

      cout << dp[n] << endl;
}
